public class MainActivity extends AppCompatActivity implements AdapterView.OnItemSelectedListener {

private EditText etFrom, etTo, etDistance;
private Spinner spVehicle;
private Button btnCalculate;
private TextView tvResult;

private String selectedVehicle;
private String[] vehicles = {“Тягач”, “Фургон”, “Пикап”};

private double[] vehiclePrices = {15, 20, 10, 25, 30, 20, 10, 15, 5};

@Override
protected void onCreate(Bundle savedInstanceState) {
super.onCreate(savedInstanceState);
setContentView(R.layout.activity_main);

// Получение ссылок на элементы пользовательского интерфейса
etFrom = findViewById(R.id.et_from);
etTo = findViewById(R.id.et_to);
etDistance = findViewById(R.id.et_distance);
spVehicle = findViewById(R.id.sp_vehicle);
btnCalculate = findViewById(R.id.btn_calculate);
tvResult = findViewById(R.id.tv_result);

// Создание адаптера для спиннера
ArrayAdapter<String> adapter = new ArrayAdapter<>(this, android.R.layout.simple_spinner_item, vehicles);

// Установка адаптера для спиннера
spVehicle.setAdapter(adapter);
spVehicle.setOnItemSelectedListener(this);

// Установка слушателя для кнопки “Рассчитать”
btnCalculate.setOnClickListener(new View.OnClickListener() {
@Override
public void onClick(View v) {
calculate();
}
});
}

private void calculate() {

// Получение значений входных данных
String from = etFrom.getText().toString();
String to = etTo.getText().toString();
String distanceString = etDistance.getText().toString();

// Проверка наличия значений входных данных
if (from.length() == 0) {
Toast.makeText(this, R.string.error_from, Toast.LENGTH_SHORT).show();
return;
}
if (to.length() == 0) {
Toast.makeText(this, R.string.error_to, Toast.LENGTH_SHORT).show();
return;
}
if (distanceString.length() == 0) {
Toast.makeText(this, R.string.error_distance, Toast.LENGTH_SHORT).show();
return;
}

double distance = Double.parseDouble(distanceString);

// Расчет итоговой стоимости маршрута
double totalPrice = findPrice(selectedVehicle) * distance;

// Отображение результата
tvResult.setText(getString(R.string.result, selectedVehicle, from, to, distanceString, totalPrice));
}

private double findPrice(String vehicle) {

// Поиск стоимости автомобиля
int index = 0;

for (int i = 0; i < vehicles.length; i++) {
if (vehicles[i].equals(vehicle)) {
index = i;
break;
}
}

return vehiclePrices[index];
}

@Override
public void onItemSelected(AdapterView<?> parent, View view, int position, long id) {
// Получение выбранного автомобиля
selectedVehicle = (String) parent.getItemAtPosition(position);
}

@Override
public void onNothingSelected(AdapterView<?> parent) {
selectedVehicle = “Тягач”;
}

}


